import React from 'react'
import '../../stylesheets/waterheaterheader.css'
const whaterheaterheader = () => {
    return (
        <>
            <div className="rowFlex">
                <p className ="header">
                     <img src="images/Searching applicable rebates and incentives.svg" alt="" className="headerIcon"/>
                     <span>Your project qualifies you for</span> <span className="incentive">incentves!</span></p>
            </div>
        </>
    )
}

export default whaterheaterheader;
